import styled from "styled-components";
import { Button } from "antd";


export const LoginButton = Button`
 width: 120px
`

export const LoginFormWrapper = styled.div`
  margin-top: 20px;
  margin-left: 10px;
  `
  export const LoginButtonWrapper = styled.div`
    margin-top: 10px;
  `
